import Topmenu from "../Topmenu";
import { Navigate, Outlet } from "react-router-dom";

const ProtectedRoutes = () => {
  //   return auth?.token ? (
  return true ? (
    <>
      <Topmenu />
      <div className="container-fluid ">
        <Outlet />
      </div>
    </>
  ) : (
    <Navigate to="/login" replace />
  );
};

export default ProtectedRoutes;
